const brandsIndexed = _.keyBy(brand, "id")

const categoryIndexed = _.keyBy(category, "id")

const userIndexed = _.keyBy(users, "id")
devices.forEach(device => {
    device.user = userIndexed[device.user_id]
    device.brand = brandsIndexed?.[device.brand_id]?.["brand"]
    device.category = categoryIndexed[device.category_id].category
    device.name = device.brand + " " + device.model
})

const result = devices.map(device => {
    const res ={}
    res.name = device.name
    res.category = device.category
    res.inv_number = device.inv_number
    res.user = device.user.full_name
    res.date = device.date_purchase
    res.comment = device.comments
    res.status = device.status_rus
    return res
})
const fs = require("fs")
fs.writeFileSync("devices.txt", JSON.stringify(result))
console.log(result)